import { Router } from "react-router-dom";
import "./App.css";
import Chan from "./components/chan";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            exact
            element={
              <Loginpage
                authService={authService}
                setloginstatus={setloginstatus}
                loginstatus={loginstatus}
              />
            }
          ></Route>
          <Route
            path="/main"
            exact
            element={
              <Main
                authService={authService}
                FileInput={FileInput}
                cardRepository={cardRepository}
              />
            }
          ></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
